import React from 'react'
import Slider from 'react-slick'



function TrendingCard(props){


    console.log(props.data)


    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      }

    return(
        <div >
        <Slider {...settings}>
 {props.data.map((e)=>{
     
        return <div key={e.id}>
            <h1>{e.attributes.canonicalTitle}</h1>
            <img alt={e.attributes.canonicalTitle} src={e.attributes.posterImage.small}></img>
        </div>
    })}
    </Slider>
        </div>
       )
}

export default TrendingCard
